import React from 'react';
import Navbar from './Navbar';

function HomePage() {
  return (
    <div>
      <Navbar />
      <div className="container mx-auto p-8">
        <h1 className="text-4xl font-bold mb-4">Welcome to Practo Home</h1>
        <p>Select an option from the navbar to add a doctor or practice.</p>
      </div>
    </div>
  );
}

export default HomePage;
